  render() {
    return (
      <>
        <div className="header">
          <nav className="flex container">
            <h1>
              <a href="#">conduit</a>
            </h1>
            <ul>
              <a href="#">Home</a>
              <a href="#">Sign in</a>
              <a href="#">Sign up</a>
            </ul>
          </nav>
        </div>

        <section className="hero">
          <h2>conduit</h2>
          <p>A place to share your knowledge.</p>
        </section>

        <footer className="footer">
          <a href="#">
            <i class="fa fa-github" aria-hidden="true"></i>
            Fork on GitHub
          </a>
        </footer>
      </>
    );
  }
}

export default App;
